    false,nt"url": null,nt"notes": "This annual narrative report for Horicon
    NWR, Fox River NWR, Wisconsin Islands Wilderness, Green Bay NWR, Gravel Islands
    NWR outlines Refuge accomplishments during the 1982 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. The report includes
    a planning section which discusses research and investigations. Refuge administration
    is outlined; information about personnel, youth programs, manpower programs, volunteer
    programs, funding, and safety is given. Habitat management is also covered; subjects
    include wetlands, forests, croplands, grasslands, fire management, and pest control.
    The wildlife section of the report discusses wildlife diversity, endangered and
    threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
    game mammals, fisheries resources, animal control, marking and bird banding, and
    disease control. The public uses of the Refuge described in this report include
    outdoor classrooms, interpretive programs, hunting, fishing, trapping, wildlife
    observation, and law enforcement. The equipment and facilities section of the report
    provides information about new construction, rehabilitation, major maintenance,
    equipment replacement, and energy conservation. Cooperative programs and items of
    interest are provided at the end. Refuge brochures are attached.",nt"license_title":
